        context.saveGState()
        context.translateBy(x: 15, y: 21)
        UIColor(hue: 0.587, saturation: 1, brightness: 1, alpha: 1).setFill()
        fill.fill()
        context.restoreGState()
        /// knob
        let knob = UIBezierPath(ovalIn: CGRect(x: 0, y: 0, width: 28, height: 28))
        context.saveGState()
